def readFileAsByteArray(file_path):
    with open(file_path, 'rb') as file:
        byte_array = file.read()
        file.close()
    return bytearray(byte_array)

def writeByteArrayAsFile(file_path, byte_array):
    with open(file_path, 'wb') as file:
        file.write(byte_array)

def CalculateChecksum(byteArray,start,end):
    array = []
    for i in range(start,end + 1):
        array.append(byteArray[i])
    checksum =(~(sum(array) & 0xFF)) & 0xFF
    return checksum

def getSlicedArray(byteArray,start,length):
    array = []
    for i in range(start,start + length):
        array.append(byteArray[i])
    return array

def changeArray(originalArray,newArray,offset):
    copyArray = originalArray
    for i in range(len(newArray)):
        copyArray[offset + i] = newArray[i]
    return copyArray

def printbyteArrayInHexStr(array):
    hex_string = '[' + ','.join(hex(byte) for byte in array) + ']';
    print(hex_string)

def convertArray(slicedArray):
    global unsupportedCharacter
    global terminator
    
    result = []
    for i in range(0, len(slicedArray)):
        result.append(slicedArray[i])

    i = 0
    while i < len(slicedArray):
        bytes = []
        if slicedArray[i] == terminator:
            return result
            
        
        if slicedArray[i] in codeTableCKN2NewSingle:
            resultIntValue = codeTableCKN2NewSingle[slicedArray[i]]
            resultbytes = resultIntValue.to_bytes(1, byteorder='big')
            result[i] = resultbytes[0]
            i += 1
            continue
        
        if i + 1 < len(slicedArray):
            bytes.append(slicedArray[i])
            bytes.append(slicedArray[i + 1])
            intValue = int.from_bytes(bytes, byteorder='big', signed=False)
            if intValue in codeTableCKN2New:
                resultIntValue = codeTableCKN2New[intValue]
                resultbytes = resultIntValue.to_bytes(2, byteorder='big')
                result[i] = resultbytes[0]
                result[i + 1] = resultbytes[1]
            else:
                if intValue in codeCharCKN2NewUnsupported:
                    unsupportedChar = codeCharCKN2NewUnsupported[intValue]
                    print('不支持旧版字符：'+ unsupportedChar)
                    print('将用？代替该字符')
                    unsupportedCharacter = True
                    result[i] = 0x01
                    result[i + 1] = 0xF5
                else:
                    for t in range(2):
                        if bytes[t] == terminator:
                            return result
                        if bytes[t] in codeCharCKN2NewSingle2:
                            result[i + t] = bytes[t]
                        else:
                            result[i + t] = 0xE6
                            print(hex(bytes[t]))
                            unsupportedCharacter = True
                            print('码表未找到')
                            print('将用?代替该字符')
        i += 2
    return result

def convertAt(byteArray,offset,length,desc):
    newArray = byteArray
    slicedArray = getSlicedArray(newArray,offset,length)
    if sum(slicedArray) == 0:
        return newArray
    if sum(slicedArray) == terminator * length:
        return newArray
    if sum(slicedArray) == 0xFF * length:
        return newArray
    convertedArray = convertArray(slicedArray)
    newArray = changeArray(newArray,convertedArray,offset)
    prevName = getPrintedStr(slicedArray,0)
    afterName = getPrintedStr(slicedArray,1)
    if prevName == afterName:
        print(desc + '名字：' + afterName)
        names.append(afterName)
    else:
        print(desc + '转换前名字：' + prevName)
        print(desc + '转换后名字：' + afterName)
        names.append(afterName)
    print('转换前的码表：')
    printbyteArrayInHexStr(slicedArray)
    print('转换后的码表：')
    printbyteArrayInHexStr(convertedArray)
    print()
    return newArray

def setChecksum(array,start,end,setOffset,desc):
    newArray = array
    checksum = CalculateChecksum(newArray,start,end)

    print(desc + ' Checksum 是：' + hex(checksum))
    newArray[setOffset] = checksum
    print()
    return newArray

def getPrintedStr(slicedArray,mode):
    global terminator
    string = ''

    i = 0
    while i < len(slicedArray):
        bytes = []
        if slicedArray[i] == terminator:
            return string
        
        if slicedArray[i] in codeCharCKN2NewSingle:
            string += codeCharCKN2NewSingle[slicedArray[i]]
            i += 1
            continue

        if i + 1 < len(slicedArray):
            bytes.append(slicedArray[i])
            bytes.append(slicedArray[i + 1])
            intValue = int.from_bytes(bytes, byteorder='big', signed=False)
            if intValue in codeCharCKN2New:
                string += codeCharCKN2New[intValue]
            else:
                if not intValue in codeCharCKN2NewUnsupported:
                    for t in range(2):
                        if bytes[t] == terminator:
                            return string
                        if slicedArray[i + t] in codeCharCKN2NewSingle2:
                            string += codeCharCKN2NewSingle2[slicedArray[i + t]]
                        else:
                            if mode == 1:
                                string += "?"
                else:
                    if mode == 0:
                        string += codeCharCKN2NewUnsupported[intValue]
                    else:
                        string += "？"
        i += 2
    return string

